  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains heat flow observations
  compiled by the Arizona Geological Survey, and published as a Web feature service
  for the National Geothermal Data System. Fields in the Heat Flow Observation Content
  Model will become XML elements in interchange documents for WMS simple features
  provided by a node in the USGIN network. Each feature includes an Observation Name,
  Interval Depth, Gradient, Uncorrected Heat Flow, units and Source. The dataset is
  spatially referenced to EPSG: 4326 (for interoperability). The data contained in
  the submitted dataset is available as an Excel Spreadsheet, ESRI service, WMS and
  WFS service. Link to Heat Flow Observation Content Model: http://www.stategeothermaldata.org/data_delivery/content_models/heat_flow.\",\n\t\"license_title\":
